Encontrar impresora falla, por favor, compruebe como siguiente:
 1.Si está encendido la impresora;
 2.El dispositivo actual y la impresora se encuentra en la misma LAN;
 3.Si la comunicación entre los dispositivos en la LAN actual se encuentra restringidas o no.

Establecimiento falla, por favor, consulte la siguiente:
 1.Si está encendido la impresora;
 2.La red seleccionada llega el límite conectado máximo;
 3.La red seleccionada prohibe la conexión de equipo;
 4.Si la contraseña de red entrada es correcta.
